bm_function.script_text:
/* Help Me Choose Selector */

//Define stuff
s = "<SelectorSearchResults>"; x = 0; item = "";
subDom = lower(_BM_USER_COMPANY);


//Columns
s = s + "<Columns>";
	s = s + "<Column name = 'ProductDetails' title='Product Details' align='Center' width='80%'>1</Column>";
	s = s + "<Column name = 'Button' title='Base Price' align='Center' width='20%' sort='false'>2</Column>";
s = s + "</Columns>";

// Item loop (loop over models and use model attributes)
s = s + "<Items>";
for i in _ITEMS{

	// continue for server solutions model
	if(i._bm_model_name == "Server Solutions"){
		continue;
	}

	//help me choose and advanced filter models
	showOperatingSystem = false;
	showProcessor = false;
	showSystem = false;
	showFormFactor = false;
	showAbility = false;
	showEmployees = false;
	showData = false;


if(operatingSystem_selector == "All Operating Systems" AND processors_selector == "All Processors" AND serverChassis_selector == "All Systems" AND formFactor_selector == "All Form Factors"){	
	// Determine which server to use based on ability selection


	// Determine which server to use based on employees
	if(howManyEmployeesDoYouHaveNow == "> 500" OR howManyEmployeesDoYouHaveNow == "251 - 500"){
		if(find(i._bm_model_name, "Ultra") > -1){
			showEmployees = true;
		}
	}elif(howManyEmployeesDoYouHaveNow == "101 - 250" OR howManyEmployeesDoYouHaveNow == "26 - 100"){
		if(find(i._bm_model_name, "Sentinel") > -1){
			showEmployees = true;
		}
	}else{
		if(find(i._bm_model_name, "Green") > -1){
			showEmployees = true;
		}
	}


	// Determine which server to use based on data storage
/*	if(howMuchDataDoYouCurrentlyManageAndStore == "> 100 TB" OR howMuchDataDoYouCurrentlyManageAndStore == "10 TB -100 TB"){
		if(find(i._bm_model_name, "Ultra") > -1 OR find(i._bm_model_name, "Sentinel") > -1){
			showData = true;
		}
	}elif(howMuchDataDoYouCurrentlyManageAndStore == "5 TB - 10 TB" OR howMuchDataDoYouCurrentlyManageAndStore == "1 TB - 5 TB"){
		if(find(i._bm_model_name, "Sentinel") > -1 OR find(i._bm_model_name, "Green") > -1){
			showData = true;
		}
	}else{
		if(find(i._bm_model_name, "Green") > -1){
			showData = true;
		}
	}
	*/

	//filter results based on above
	if(NOT(showEmployees)){ // AND showData AND showAbility)){
		continue;
	}


}else{
	//Determine which server to use based on advanced search
	if(operatingSystem_selector == "All Operating Systems"){ 
		showOperatingSystem = true;
	}else{
		if(find(i._bm_model_operatingSystem, operatingSystem_selector) > -1){ showOperatingSystem = true; }
	}
	if(processors_selector == "All Processors"){
		showProcessor = true;
	}else{
		if(find(i._bm_model_processor, processors_selector) > -1){ showProcessor = true; }
	}
	if(serverChassis_selector == "All Systems"){
		showSystem = true;
	}else{
		if(find(i._bm_model_name, substring(serverChassis_selector,0,find(serverChassis_selector," "))) > -1){ showSystem = true; }
	}
	if(formFactor_selector == "All Form Factors"){
		showFormFactor = true;
	}else{	
		if(find(i._bm_model_formFactor, formFactor_selector) > -1){ showFormFactor = true; }
	}


	//filter results based on above
	if(NOT(showOperatingSystem AND showProcessor AND showSystem AND showFormFactor)){
		continue;
	}

}	

	// define html display structure for results
	h = "";
	if(x == 0){
		h = h + "<link rel=\"stylesheet\" type=\"text/css\""; 
		h = h + "href=\"https://" + subDom + ".bigmachines.com/bmfsweb/" + subDom + "/config/style/selector_alt.css\">";
	}
	h = h + "<div class='outterWrap_selDisp'>";		
		h = h + "<div class='innerLeft_selDisp'>";
			h = h + "<a href='/commerce/new_equipment/products/model_configs.jsp?segment=vision&product_line=servers&model=serverSolutions";
			h = h + i._bm_model_configurationLink;
			h = h + "'&_variable_name_punchin=true'>";
			h = h + "<img src='https://" + subDom + ".bigmachines.com/bmfsweb/" + subDom + i._bm_model_imageURL + "' alt='" + i._bm_model_name + "'></a>";
			h = h + "<div class='selButton'>";
			h = h + "<a href='/commerce/new_equipment/products/model_configs.jsp?segment=vision&product_line=servers&model=serverSolutions"; 
			h = h + i._bm_model_configurationLink;
			h = h + "&_variable_name_punchin=true'>Configure Now</a>";
			h = h + "</div>";
		h = h + "</div>";

		h = h + "<div class='innerRight_selDisp'>";
			h = h + "<h5><a href='/commerce/new_equipment/products/model_configs.jsp?segment=vision&product_line=servers&model=serverSolutions";
			h = h + i._bm_model_configurationLink;
			h = h + "'&_variable_name_punchin=true'>";
			h = h + i._bm_model_name + "</a></h5>";
			h = h + "<ul class='obullets_selDisp'>";
				h = h + "<li>Operating System: <span class='subBullets_selDisp' >" + i._bm_model_operatingSystem + "</span></li>";
				h = h + "<li>Processor: <span class='subBullets_selDisp' >" + i._bm_model_processor + "</span></li>";
				h = h + "<li>Number of Sockets: <span class='subBullets_selDisp' >Up to " + string(i._bm_model_sockets) + "</span></li>";
				h = h + "<li>Number of Cores: <span class='subBullets_selDisp' >Up to " + string(i._bm_model_cores) + "</span></li>";
				h = h + "<li>Number of Threads: <span class='subBullets_selDisp' >Up to " + string(i._bm_model_threads) + "</span></li>";
				h = h + "<li>CPU Speed: <span class='subBullets_selDisp' >" + i._bm_model_cpuSpeed + "</span></li>";
				h = h + "<li>Memory Size: <span class='subBullets_selDisp' >" + i._bm_model_memory + "</span></li>";
				h = h + "<li>Form Factor: <span class='subBullets_selDisp' >" + i._bm_model_formFactor + "</span></li>";
			h = h + "</ul>";
		h = h + "</div>";

		h = h + "<input type=\"button\" onclick=\"growDiv('viewDetails_selector" + string(x) + "')\"";
		h = h + " value=\"Product Details\" id='more-button" + string(x) + "' class='slide_selector'>";
		h = h + "<div id='viewDetails_selector" + string(x) + "'>";
			h = h + "<div class='measuringWrapper'>";
				h = h + "<div class='viewDetailsLeft_selector'>";
					h = h + "<h5 class='viewDetailsHeader_selector'>" + i._bm_model_simpleDescription + "</h5>";
					h = h + "<p class='viewDetailsDeets_selector'>" + i._bm_model_description + "</p>";
				h = h + "</div>";
				h = h + "<div class='viewDetailsRight_selector'>";
					h = h + "<div class='viewDetailsLinks_selector'>";
						h = h + "<a target='_blank' href='https://" + subDom + ".bigmachines.com/bmfsweb/" + subDom + i._bm_model_link1 + "'>Data Sheet</a>";
					h = h + "</div>";
					h = h + "<div class='viewDetailsLinks_selector'>";
						h = h + "<a target='_blank' href='" + i._bm_model_link3 + "'>More Info</a>";
					h = h + "</div>";
					h = h + "<div class='viewDetailsLinks_selector'>";
						h = h + "<a target='_blank' href='" + i._bm_model_link3 + "'>Cloud Infrastructure</a>";
					h = h + "</div>";
				h = h + "</div>";
			h = h + "</div>";
		h = h + "</div>";
	h = h + "</div>";

	// define html button structure
	b = "<div class='priceButton'>";
	b = b + "<a href='/commerce/new_equipment/products/model_configs.jsp?segment=vision&product_line=servers&model=serverSolutions";
	b = b + i._bm_model_configurationLink;
	b = b + "&_variable_name_punchin=true'>Starting at " + formatascurrency(i._bm_model_basePrice);
	b = b + "</div>";


	//Create actual Item 
	item = "";
	item= item+ "<Item>";

		//Product Summary Display	
		item= item+ "<Attributes>";
			item= item+ "<Attribute title='Product Details' align='left'>";
				item= item+ "<![CDATA[";
					item= item+ h;
				item= item+ "&_cd;";
			item= item+ "</Attribute>";
		item= item+ "</Attributes>";		

		//Price Button			
		item= item+ "<Attributes>";
			item= item+ "<Attribute title='Base Price' align='left'>";
				item= item+ "<![CDATA[";
					item= item+ b;
				item= item+ "&_cd;";
			item= item+ "</Attribute>";
		item= item+ "</Attributes>";

	item= item+ "</Item>";
s = s + item;
x = x + 1;
}

if(item == ""){
	s = s + "<Item><Attributes><Attribute title='Product Details' align='left'>";
	s = s + "There are no matching options that meet your requirements</Attribute></Attributes>";
	s = s + "<Attributes><Attribute title='Base Price' align='left'></Attribute></Attributes></Item>";
}

s = s + "</Items>";
s = s + "</SelectorSearchResults>";


return s;

